export default function Hero() {

  const code = `
    // Javascript syntax example
    const foo = 'bar';
    let count = 0;
    count += 1;
    console.log('Foo:', foo);
  `;
  return (
    <div className="code-sample">
      <h1>Javascript</h1>
      <Highlight language="javascript" content={code} />
    </div>
  )
}
